sparqlQueGG:
SELECT DISTINCT ?program WHERE {
  ?program a <http://dbpedia.org/ontology/FrequentFlyerProgram> .
  {
    SELECT ?program (COUNT(?airline) AS ?count) WHERE {
      ?airline <http://dbpedia.org/ontology/frequentFlyerProgram> ?program .
    } GROUP BY ?program
  } ORDER BY DESC(?count) LIMIT 1
}

SELECT DISTINCT ?country WHERE { 
?cave1 a <http://dbpedia.org/ontology/Cave> ; 
        <http://dbpedia.org/ontology/location> ?country .
?cave2 a <http://dbpedia.org/ontology/Cave> ; 
        <http://dbpedia.org/ontology/location> ?country .
FILTER (?cave1 != ?cave2)
}

SELECT DISTINCT ?uri WHERE { 
  ?uri a <http://dbpedia.org/ontology/AdministrativeRegion> ;
  <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/United_States> ;
  <http://dbpedia.org/ontology/populationDensity> ?density 
} ORDER BY DESC(?density) OFFSET 0 LIMIT 1

SELECT ?state (count(?volcano) as ?volcanoCount)
WHERE {
 ?volcano a <http://dbpedia.org/ontology/Volcano> ;
 <http://dbpedia.org/ontology/location> ?state .       
} 
GROUP BY ?state
HAVING (count(?volcano) > 10)

SELECT DISTINCT ?uri ?height WHERE { 
  ?uri a <http://dbpedia.org/ontology/BasketballPlayer> ;
  <http://dbpedia.org/ontology/height> ?height ;
  <http://dbpedia.org/ontology/team> ?team .
  ?team a <http://dbpedia.org/ontology/BasketballTeam> .
  FILTER EXISTS {?uri <http://dbpedia.org/ontology/activeYearsEndYear> ?year . FILTER(?year > "2020"^^xsd:date) }
}
ORDER BY ASC(?height)
LIMIT 1

SELECT DISTINCT ?uri ?time WHERE { 
  <http://dbpedia.org/resource/John_F._Kennedy> <http://dbpedia.org/ontology/deathDate> ?deathDate .
  ?uri <http://dbpedia.org/ontology/successor> <http://dbpedia.org/resource/John_F._Kennedy> ;
       <http://dbpedia.org/ontology/termPeriod> ?termPeriod .
  ?termPeriod <http://dbpedia.org/ontology/startTime> ?startTime .
  FILTER(?deathDate <= ?startTime)
} ORDER BY ?startTime LIMIT 1

SELECT DISTINCT ?player WHERE { 
  ?player a <http://dbpedia.org/ontology/SoccerPlayer> ; 
           <http://dbpedia.org/ontology/league> <http://dbpedia.org/resource/Premier_League> ;
           <http://dbpedia.org/ontology/birthDate> ?birthDate 
} ORDER BY DESC(?birthDate) OFFSET 0 LIMIT 1

SELECT (COUNT(DISTINCT ?river) AS ?riverCount) (COUNT(DISTINCT ?lake) AS ?lakeCount) WHERE {
  { SELECT ?river WHERE { ?river a <http://dbpedia.org/ontology/River> ; <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/South_Carolina> } }
  UNION
  { SELECT ?lake WHERE { ?lake a <http://dbpedia.org/ontology/Lake> ; <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/South_Carolina> } }
}
